import React from "react";
import { Between, Line, Rows } from "../../assets/UiKit/Line/Line";
import { Grid } from  "../../assets/UiKit/grid/Gird";
export default function petCardSearch(props) {
  return (
    <div className="dogProfileCard">
{/* <Grid> */}
      <Rows addClass="between" >
        <h5 className="cardStatus">Available</h5>
        <h3>Rexy</h3>
        <h5 className="cardType">Dog</h5>
      </Rows>

      {/* </div> */}
      <div className="">
        <img
          className="dogProfilePicture"
          src="https://images.unsplash.com/photo-1558788353-f76d92427f16?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxzZWFyY2h8M3x8Z29sZGVuJTIwZG9nfGVufDB8fDB8fA%3D%3D&w=1000&q=80"
        />
      </div>
      <div className="generalInfo">
        <h4>breed</h4>
        <h5>Bio</h5>
        <h5>Age:2</h5>
      </div>

      <button>Adopt</button>
      {/* </Grid> */}
    </div>
  );
}
